import { Menubar } from "primereact/menubar";


const Navbar = () => {
   
        const items = [
          {
            label: "Home",
            icon: "pi pi-fw pi-home",
            url: "/"
          },
          {
            label: "Product",
            icon: "pi pi-fw pi-shopping-bag",
            url: "/product"
          },
          {
            label: "Contact",
            icon: "pi pi-fw pi-mobile",
            url: "/contact"
          },
          {
            separator:true
          },
        {label: "Users",
          icon: "pi pi-fw pi-user",
          items: [
            // {
            //   label: "Login",
            //   icon: "pi pi-fw pi-user-plus",
            // },
            {
              label: "Settings",
              icon: "pi pi-fw pi-cog",
              url:"/usersettings",
            },
          ],
        },
        {
            label
        }
        ];
       
      
    return ( 
        <div>
            <Menubar model={items} />
        </div>
        
        
     );
}
 

export default Navbar;
